const WORD_INDEX = JSON.parse(wordIndex);

export default class TextAnalyzer extends Component {
  static propTypes = {
    title: PropTypes.string.isRequired,
    thumbnail: PropTypes.string.isRequired,
    stars: PropTypes.number.isRequired,
    description: PropTypes.string.isRequired,
    downloads: PropTypes.number.isRequired,
    onClose: PropTypes.func.isRequired,
  };


  state = {
    textError: null,
    result: .52456,
    isAnalyzing: false,
  };

  constructor(props) {
    super(props);
    this.model = new KerasJS.Model({
      filepath: props.model,
      gpu: false,
    });
  }

  renderLeft() {
    return (
      <div className="algo-modal__image-upload">
        <textarea
          className="algo-modal__text-area"
          onChange={e => this.analyze(e.target.value)}
          placeholder="Enter text here..."
        />
      </div>
    );
  }

  analyze = async text => {
    if (!text) {
      return this.setState({
        textError: null,
        result: null,
        isAnalyzing: false,
      });
    }

    this.setState({
      textError: null,
      result: null,
      isAnalyzing: true,
    });

    const value = new Float32Array(MAXLEN);

    const parsedText = text
      .trim()
      .toLowerCase()
      .split(/[\s.,!?]+/gi);

    let indices = parsedText.map(word => {
      const index = WORD_INDEX[word];
      return !index ? OOV_WORD_INDEX : index + INDEX_FROM;
    });

    indices = [START_WORD_INDEX].concat(indices)
    indices = indices.slice(-MAXLEN)

    // padding and truncation (both pre sequence)
    const start = Math.max(0, MAXLEN - indices.length);
    for (let i = start; i < MAXLEN; i++) {
      value[i] = indices[i - start];
    }

    try {
      await this.model.ready();
      const outputData = await this.model.predict({ input: value });
      const [result] = new Float32Array(outputData.output);
      this.setState({
        textError: null,
        result,
        isAnalyzing: false,
      });
    } catch (err) {
      this.setState({
        textError: err.message,
        result: null,
        isAnalyzing: false,
      });
    }
  }

  getResultColor(val) {
    if (val < .4) {
      return 'ff0000';
    }

    if (val > .6) {
      return '#00ce30';
    }

    return '#ff9d00';
  }

  renderRight() {
    const { textError, result, isAnalyzing } = this.state;

    if (isAnalyzing) {
      return (
        <div className="algo-modal__results">
          <div className="algo-modal__has-image">
            <div className="algo-modal__spinner" />
            <div className="algo-modal__loading-text">Analyzing...</div>
          </div>
        </div>
      );
    }

    if (textError) {
      return (
        <div className="algo-modal__results">
          <div className="algo-modal__has-image">
            {textError}
          </div>
        </div>
      );
    }

    if (!result) {
      return (
        <div className="algo-modal__results">
          <div className="algo-modal__no-image-text">
            Enter text on the right
          </div>
        </div>
      );
    }

    return (
      <div className="algo-modal__results">
        <div className="algo-modal__has-image">
          <div
            className="algo-modal__text-result"
            style={{
              color: this.getResultColor(result),
            }}
          >
            {`${(result * 100).toFixed(2)}%`}
          </div>
        </div>
      </div>
    );
  }

  render() {
    const { title, thumbnail, stars, description, downloads, onClose } = this.props;

    return(
      <div className="algo-modal" onClick={e => e.stopPropagation()}>
        <div className="algo-modal__header">
          <div
            style={{ backgroundImage: `url(${thumbnail})` }}
            className="algo-modal__image"
          />
          <div className="algo-modal__header-content">
            <div className="algo-modal__header-title">{title}</div>
            <div className="algo-modal__header-description">{description}</div>
            <div className="marketplace__algo-card__stars">{`${stars} (${downloads})`}</div>
          </div>
          <div className="algo-modal__actions">
            <button className="algo-modal__buy-btn">Buy</button>
          </div>
          <div
            className="algo-modal__close"
            onClick={onClose}
          />
        </div>
        <div className="algo-modal__content">
          <div className="algo-modal__image-recognition">
            { this.renderLeft() }
            { this.renderRight() }
          </div>
        </div>
      </div>
    );
  }
}
